import math from './resources/math.png';
import science from './resources/science.png';
import accomplishments from './resources/accomplishments.png';
import React from 'react';
import "./Header.css";
import home from './resources/home.png';;

class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <img class="Image" src={home}></img>
                <img class="Image" src={math}></img>
                <img class="Image" src={science}></img>
                <img class="Image" src={accomplishments}></img>
            </div>
        )
    }
}
export default Header;
